import React from 'react';

class Calendar extends React.Component {
  render() {
    return (
        <iframe src="https://calendar.google.com/calendar/embed?height=300&amp;wkst=2&amp;bgcolor=%23ffffff&amp;ctz=Europe%2FLondon&amp;src=bW4yZWhiMTMycm9iZW1tdTlqdmliamtjcmNAZ3JvdXAuY2FsZW5kYXIuZ29vZ2xlLmNvbQ&amp;color=%238E24AA&amp;showTitle=0&amp;showNav=1&amp;showDate=1&amp;showPrint=0&amp;showTabs=1&amp;showCalendars=0&amp;showTz=0" style="border-width:0" width="500" height="300" scrolling="no"></iframe>
    );
  }
}

export default Calendar;
